import { IMPORTUSER } from "../actions/importUserAction";

const userReducer = (state = {}, action) => {
  switch (action.type) {
    case IMPORTUSER:
      return { ...action.payload };
      break;

    default:
      return state;
  }
};

export default userReducer;
